import React, { Component } from 'react';

import { Link } from 'react-router-dom';


export const Home = () => {
    const { projects } = useContext(GlobalContext);


    return (
        <div>
            <h1>List of Project</h1>
            <ul className="list">
                {projects.map(project => (<ProjectComponent key={project.id} project={project} />))}
            </ul>
        </div>
    )

}


